class App extends Component {

  state = {

  }

  componentDidMount = () => {
    io.on('air_quality_value', airQualityValue => console.log(airQualityValue))

  }

  render() {
    return (
      <div className="App">
        <a onClick={_ => {
          io.emit('air_quality')
        }}>yey</a>

      </div>
    );
  }
}


export default App;
